import React, { Component } from 'react';
//import './App.css'; /* optional for styling like the :hover pseudo-class */
import StateParks from '../pages/StateParks';
import PropTypes from 'prop-types'; 

//Material UI
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import USAMap from "react-usa-map";

class Map extends Component {

  mapHandler = (event) => {
	  //const stateCode = new Map();
     //stateCode.targetId = event.target.dataset.name;
	  //var targetId = {value: event.target.dataset.name};
	  var targetId = event.target.dataset.name;
	  var id = targetId;
	  alert(targetId);
	  alert(id);
  };
  render() {
	  alert(window.location.pathname);
    return (
      <div>
		<Link  color="inherit" href='/'>

		<path onClick={event => this.mapHandler(event.target.name)}>
		<USAMap />
		</path>
	</Link>
      </div>
    );
  }
}
export default Map;
